import React from 'react';
import '../App.css';
import {HomeStyled} from "./Home-styled";
import {TextStyled} from "../styledComponent/TextStyled";
import {TextFilledStyled} from "../styledComponent/TextFilled-styled";
import {ButtonFilledStyled} from '../styledComponent/ButtonFilled-styled';
import {ButtonStyled} from '../styledComponent/Button-styled';
import {useStore} from "effector-react/effector-react.mjs";
import {currentUser, deleteUser, rememberUser} from "../BLL/effector/usersStoreLogined";
import {ExitStyled} from "./Exit-styled";


 const Exit: React.FC = () => {
     const handleLogoutUser = () => deleteUser()


     return (
         <ExitStyled>
             <TextStyled textSize={15} color={'black'} fontWeight={'bold'}>
                 You are in system. Press the button to logout.
             </TextStyled>
             <ButtonFilledStyled justifycontent={'center'} width={30} height={30}>
                 <ButtonStyled onClick={handleLogoutUser}>
                     <Link to="/login">Logout</Link>
                 </ButtonStyled>
             </ButtonFilledStyled>
         </ExitStyled>

     )
 }


export default Exit;
